import React from "react";
import StyleMain from "../Style/main";
import FirstSection from "./sections/FirstSection/FirstSection";
import SecondSection from "./sections/SecondSection/SeconSection";
import ThirtSection from "./sections/ThirdSection/ThirtSection";

const Main = () => (
  <StyleMain>
    <FirstSection />
    <SecondSection />
    <ThirtSection />
  </StyleMain>
);

export default Main;
